() => {
  var to_emp;
  console.log("thevaluessss", fromEmpSelect.selectedOptionValue, toEmpSelect.selectedOptionValue, kraSelect.selectedOptionValue, cycleSelect.selectedOptionValue, reviewerSelect.selectedOptionValue);
  if (fromEmpSelect.selectedOptionValue.length === 0 || toEmpSelect.selectedOptionValue.length === 0 || cycleSelect.selectedOptionValue.length === 0 || kraSelect.selectedOptionValue.length === 0) {
    return getFeedback.data.map(feed => ({
      From_name: getEmployees.data.find(emp => feed.from_employee == emp.id).name,
      To_name: (to_emp = getEmployees.data.find(emp => feed.to_employee == emp.id)) != undefined ? to_emp.name : NaN,
      Category: getKraCategories.data.find(kra => feed.category == kra.id).name,
      Feedback_continue: feed.feedback_continue,
      Feedback_can_do_more: feed.feedback_more_of,
      Rating: feed.rating,
      Feedback_type: feed.feedback_type,
      Cycle: feed.cycle
    }));
  } else {
    const tableData = getFeedback.data.map(feed => {
      if (feed.from_employee == fromEmpSelect.selectedOptionValue && feed.to_employee == toEmpSelect.selectedOptionValue && feed.category == kraSelect.selectedOptionValue && feed.cycle == cycleSelect.selectedOptionLabel) {
        return {
          From_name: getEmployees.data.find(emp => feed.from_employee == emp.id).name,
          To_name: (to_emp = getEmployees.data.find(emp => feed.to_employee == emp.id)) != undefined ? to_emp.name : NaN,
          Category: getKraCategories.data.find(kra => feed.category == kra.id).name,
          Feedback_continue: feed.feedback_continue,
          Feedback_can_do_more: feed.feedback_more_of,
          Rating: feed.rating,
          Feedback_type: feed.feedback_type,
          Cycle: feed.cycle
        };
      }
    }).filter(e => e);
    console.log("heretableDataInn", tableData);
    return tableData;
  }
}

